import React from 'react';

interface Props {
  items: string[];
}

export default function ToDoListItem({ items }: Props) {
  return (
    <div>
      <h2>ToDo List</h2>
      <ul>
        {items.map((item, index) => (
          <li key={index}>{item}</li>
        ))}
      </ul>
    </div>
  );
}
